import React from 'react'
import { MenuList } from "../helpers/TatlıList"

function Tatlılar() {
  return (
    <div className='menu'>
        <h1 className='menuTitle'>TATLILAR</h1>
        <div className='menuList'>
         {MenuList.map((menuItem,key)=>{
          return <div className='menuItem'>
            <div><img src={menuItem.image}/></div>
            <h3>{menuItem.name}</h3>
            <p>{menuItem.price} TL</p>
          </div>
         })}   
        </div>
    </div>
  )
}

export default Tatlılar
